import React, { Fragment, useEffect, useState } from "react";
import "./Components.css";
import axios from "axios";

function CourseTable() {
  const [courses, setCourses] = useState();

  useEffect(() => {
    axios.get("http://localhost:5000/courses").then(function (response) {
      console.log(response);
      setCourses(response.data);
    });

    setCourses();
  }, []);

  console.log(courses);

  var courseItems;
  if (courses) {
    courseItems = courses.map((course) => {
      var exam;
      if (course.exam === true) {
        exam = "X";
      }

      return (
        <tr>
          <td>
            <div className="form-check">
              <input
                class="form-check-input"
                type="checkbox"
                id="inlineCheckbox1"
                value="option1"
              />
            </div>
          </td>
          <td>{course.code}</td>
          <td>{course.name}</td>
          <td>{course.points}</td>
          <td>{course.level}</td>
          <td>{course.block}</td>
          <td>{course.vof}</td>
          <td>{exam}</td>
        </tr>
      );
    });
  }

  return (
    <div>
      <table className="table table-sm">
        <thead>
          <tr>
            <th scope="col">Check</th>
            <th scope="col">Kurskod</th>
            <th scope="col">Kurs</th>
            <th scope="col">Hp</th>
            <th scope="col">Niv√•</th>
            <th scope="col">Block</th>
            <th scope="col">VOF</th>
            <th scope="col">Lab</th>
          </tr>
        </thead>
        <tbody>{courseItems}</tbody>
      </table>
    </div>
  );
}

function getCourses() {}

export default CourseTable;
